function Sketchone(p) {
  p.setup = function() {
    p.createCanvas(600, 600);
  };

  p.draw = function() {
    p.background(0);
    p.noStroke();
    p.fill(255);
    p.ellipse(p.mouseX, p.mouseY, 20, 20);
  };
}

export {
    About,
    Contact,
  }
